import React from 'react';
import {Form, Input, Card} from 'semantic-ui-react';
const Login = () => {
	return(
		<div>
			<h3>Login</h3>
			<Card>
				<Form>
					<Form.Group widths='equal'>
						<Form.Field
							id="email"
							control={Input}
							label = "email"
							placeholder="email address"
							type="email"
						/>
					</Form.Group>
					<Form.Group widths='equal'>
						<Form.Field
							id="email"
							control={Input}
							label = "email"
							placeholder="email address"
							type="email"
						/>
					</Form.Group>
				</Form>
			</Card>
		</div> 
	);
};

export default Login;
